<edge STYLE="bezier" COLOR="#815fa9" WIDTH="2"/>
<node TEXT="using System.Collections.Generic;&#xa;using System.Linq;&#xa;&#xa;namespace FitNesseDEMO&#xa;{&#xa;    public class SlimBowling&#xa;    {&#xa;        public List&lt;List&lt;string&gt;&gt; doTable(&#xa;            List&lt;List&lt;string&gt;&gt; table)&#xa;        {&#xa;            Game g = new Game();&#xa;            List&lt;string&gt; rollResults =&#xa;                new List&lt;string&gt;(Enumerable.Repeat(&#xa;                    string.Empty, 21));&#xa;            List&lt;string&gt; scoreResults =&#xa;                new List&lt;string&gt;(Enumerable.Repeat(&#xa;                    string.Empty, 21));&#xa;            rollBalls(table, g);&#xa;            evaluateScores(g, table[1], scoreResults);&#xa;            return new List&lt;List&lt;string&gt;&gt;&#xa;            {&#xa;                rollResults,&#xa;                scoreResults&#xa;            };&#xa;        }&#xa;&#xa;        private void evaluateScores(Game g,&#xa;            List&lt;string&gt; scoreRow, List&lt;string&gt; scoreResults)&#xa;        {&#xa;            for (int frame = 0; frame &lt; 10; frame++)&#xa;            {&#xa;                int actualScore = g.score(frame + 1);&#xa;                int expectedScore =&#xa;                    int.Parse(scoreRow[frameCoordinate(frame)]);&#xa;                if (expectedScore == actualScore)&#xa;                    scoreResults[frameCoordinate(frame)] = &quot;pass&quot;;&#xa;                else&#xa;                    scoreResults[frameCoordinate(frame)] =&#xa;                        string.Format(&quot;Was:{0}, expected:{1}.&quot;,&#xa;                        actualScore, expectedScore);&#xa;            }&#xa;        }&#xa;&#xa;        private int frameCoordinate(int frame)&#xa;        {&#xa;            return frame &lt; 9 ? frame*2 + 1 : frame*2 + 2;&#xa;        }&#xa;&#xa;        private void rollBalls(List&lt;List&lt;string&gt;&gt; table, Game g)&#xa;        {&#xa;            List&lt;string&gt; rollRow = table[0];&#xa;            bool gotStrikeOrSpare = false;&#xa;            for (int frame = 0; frame &lt; 10; frame++)&#xa;            {&#xa;                gotStrikeOrSpare = false;&#xa;&#xa;                string firstRoll = rollRow[frame*2];&#xa;                string secondRoll = rollRow[frame*2 + 1];&#xa;                bool ignoreCase = true;&#xa;                if (string.Compare(firstRoll, &quot;X&quot;, ignoreCase)&#xa;                    == 0)&#xa;                {&#xa;                    g.roll(10);&#xa;                    gotStrikeOrSpare = true;&#xa;                   &#xa;                    // Strike on last frame: Get to roll again.&#xa;                    if (frame == 9)&#xa;                    {&#xa;                        g.roll(int.Parse(secondRoll));&#xa;                    }&#xa;                }&#xa;                else&#xa;                {&#xa;                    int firstRollInt = 0;&#xa;                    if (firstRoll == &quot;-&quot;)&#xa;                        g.roll(0);&#xa;                    else&#xa;                    {&#xa;                        firstRollInt = int.Parse(firstRoll);&#xa;                        g.roll(firstRollInt);&#xa;                    }&#xa;                    if (secondRoll == &quot;/&quot;)&#xa;                    {&#xa;                        g.roll(10 - firstRollInt);&#xa;                        gotStrikeOrSpare = true;&#xa;                    }&#xa;                    else if (secondRoll == &quot;-&quot;)&#xa;                        g.roll(0);&#xa;                    else&#xa;                        g.roll(int.Parse(secondRoll));&#xa;                }&#xa;            }&#xa;            // Got a strike or a spare on the last frame:&#xa;            // Has an extra roll.&#xa;            if (gotStrikeOrSpare)&#xa;            {&#xa;                string extraRoll = rollRow[20];&#xa;                g.roll(int.Parse(extraRoll));&#xa;            }&#xa;        }&#xa;&#xa;        private class Game&#xa;        {&#xa;            int[] rolls = new int[21];&#xa;            int currentRoll = 0;&#xa;&#xa;            public void roll(int pins)&#xa;            {&#xa;                rolls[currentRoll++] = pins;&#xa;            }&#xa;&#xa;            public int score(int frame)&#xa;            {&#xa;                int score = 0;&#xa;                int firstBall = 0;&#xa;                for (int f = 0; f &lt; frame; f++)&#xa;                {&#xa;                    if (isStrike(firstBall))&#xa;                    {&#xa;                        score += 10 +&#xa;                            nextTwoBallsForStrike(firstBall);&#xa;                        firstBall += 1;&#xa;                    }&#xa;                    else if (isSpare(firstBall))&#xa;                    {&#xa;                        score += 10 + nextBallForSpare(firstBall);&#xa;                        firstBall += 2;&#xa;                    }&#xa;                    else&#xa;                    {&#xa;                        score += twoBallsInFrame(firstBall);&#xa;                        firstBall += 2;&#xa;                    }&#xa;                }&#xa;                return score;&#xa;            }&#xa;&#xa;            private int twoBallsInFrame(int firstBall)&#xa;            {&#xa;                return rolls[firstBall] + rolls[firstBall + 1];&#xa;            }&#xa;&#xa;            private int nextBallForSpare(int firstBall)&#xa;            {&#xa;                return rolls[firstBall + 2];&#xa;            }&#xa;&#xa;            private int nextTwoBallsForStrike(int firstBall)&#xa;            {&#xa;                return rolls[firstBall + 1] + rolls[firstBall&#xa;                    + 2];&#xa;            }&#xa;&#xa;            private bool isSpare(int firstBall)&#xa;            {&#xa;                return rolls[firstBall] + rolls[firstBall + 1]&#xa;                    == 10;&#xa;            }&#xa;&#xa;            private bool isStrike(int firstBall)&#xa;            {&#xa;                return rolls[firstBall] == 10;&#xa;            }&#xa;        }&#xa;    }&#xa;}" ID="ID_956711081" CREATED="1471916598115" MODIFIED="1554721121966" COLOR="#000000" BACKGROUND_COLOR="#c898ff" STYLE="bubble">
